import React from "react";
import "./App.css";

class Button extends React.Component {
    render() {
        return (
            <div id="nav-bar">
                <div class="navs" id="academics">
                    Faculty
                </div>
                <div class="navs" id="academics">
                    Academics
                </div>
                <div class="navs" id="academics">
                    Contact
                </div>
                <div class="navs default" id="academics">
                    Home
                </div>
            </div>
        )
    }
}

class Box extends React.Component {
    render() {
        return (
            <div id="main">
                <div id="about">
                    <div class="head"></div>
                </div>
                <div id="notice">
                    <div class="head"></div>
                </div>
            </div>
        )
    }
}

class Template extends React.Component {
    render() {
        return (
            <div id="container">
                < Button />
                <div id="logo"></div>
                <footer>
                    <div id="address"></div>
                </footer>
                < Box />
            </div>
        )
    }
}

export default Template;
